import React from 'react';
import { pathFromBazierCurve } from '../utils/formulas';

const CannonBase = (props) => {
	const cannonBaseStyle = {
		fill: '#a16012',
		stroke: '#754503',
		strokeWidth: '2px',
	};

	const baseWith = 80;
	const halfBase = 40;
	const height = 60;
	const negativeHeight = height*-1;

	const cubicBezierCurve = {
		initialAxis: {
			x: -halfBase,
			y: height,
		},
		initialControlPoint: {
			x: 20,
			y: negativeHeight,
		},
		endingControlPont: {
			x: 60,
			y: negativeHeight,
		},
		endingAxis: {
			x: baseWith,
			y: 0,
		},
	};

	return (
		<g>
			<path 
				style={cannonBaseStyle}
				d={pathFromBazierCurve(cubicBezierCurve)}
			/>
			<line
				x1={-halfBase}
				y1={height}
				x2={halfBase}
				y2={height}
				style={cannonBaseStyle}
			/>
		</g>
	)
};

export default CannonBase;
